(1, 4, '2019-10-21 05:41:29', 'Deprecation Notice', 'Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.', '', 0, 0),
(2, 4, '2019-10-23 12:49:48', 'eBook: Advanced Strategies for Fast-Tracking Revenue Growth', 'Take your business in a new direction by selling more to a larger audience. Our guide explains 5 ways you can quickly add new revenue streams to your business. Link here: http://bit.ly/2m6svAN', 'http://bit.ly/2m6svAN', 0, 0),
(3, 4, '2019-11-11 18:31:19', 'Special Offer for Open Source Customers through November 29th.', 'Take advantage of a special discount when you move to a Magento Commerce cloud subscription (formerly Enterprise Edition) through November 29th. With exciting new features like Page Builder and Content Staging and Preview, now is the perfect time to contact us. Link here: http://bit.ly/2O4hPNg', 'http://bit.ly/2O4hPNg', 0, 0),
(4, 4, '2019-11-14 16:36:56', 'We need your help! How do you fulfill and ship your orders?', 'We need your help! How do you fulfill and ship your orders?', 'http://selfserve.decipherinc.com/survey/selfserve/9d5/g013/191028 ', 0, 0),
(5, 4, '2019-12-02 15:09:11', '2020: The Year You Reimagine Your Mobile Platform', 'Smarter, faster mobile shopping experiences are now achievable with Progressive Web App technology. Forrester reveals how to leverage this next-generation technology, now available on Magento Commerce 2. Reimagine your mobile environment with this exclusive report.  Link here: http://bit.ly/2W5r4zg', 'http://bit.ly/2W5r4zg ', 0, 0),
(6, 4, '2019-12-09 18:08:56', 'Online B2B purchases are set to skyrocket to $9 trillion in the US alone this year. Get in on the action with B2B and B2C selling.', 'The lines between B2B and B2C commerce are blurring. Here’s 5 reasons to go hybrid with your commerce strategy in 2020. http://bit.ly/2DPgAx0', 'http://bit.ly/2DPgAx0', 0, 0),
(7, 4, '2019-12-16 18:39:06', 'Did you know? A whopping 89% of B2B businesses now rely on digital content to guide their purchasing process.', 'Learn how you can integrate compelling content into your B2B sales strategy with our latest eBook. Download Now: http://bit.ly/368QIbu', 'http://bit.ly/368QIbu', 0, 0);

